    var CId = "";

    var font = "DroidKufi-Regular";

    var card = new Card;
    var greeting = new CardGreeting;

    function cardSelected() {

        CId = document.querySelector('input[name="card"]:checked').value;

        JsonModel.forEach(function (object) {
            if (object.Key == "Cards") {
                object.Value.forEach(function (SubObject) {
                    if (SubObject.CardID == CId) {
                        card = SubObject;
                    }
                });
            }
        });
        drawCard();
    }

    function greetingSelected() {

        GId = document.querySelector('input[name="greeting"]:checked').value;

        JsonModel.forEach(function (object) {
            if (object.Key == "Greetings") {
                object.Value.forEach(function (SubObject) {
                    if (SubObject.GreetingId == GId) {
                        greeting = SubObject;
                    }
                });
            }
        });
        drawCard();
    }

    function messageSelected() {

        MId = document.querySelector('input[name="message"]:checked').value;

        JsonModel.forEach(function (object) {
            if (object.Key == "Messages") {
                object.Value.forEach(function (SubObject) {
                    if (SubObject.MessageID == MId) {
                        message = SubObject;
                    }
                });
            }
        });
        drawCard();
    }

        font = document.querySelector('input[name="FontType"]:checked').value;

    function drawCard() {


        if (document.querySelector('input[name="card"]:checked') != null) {

            var HDisplay = document.getElementById("HDisplay");
            var VDisplay = document.getElementById("VDisplay");
            var HDisplayFancy = document.getElementById("HDisplayFancy");
            var VDisplayFancy = document.getElementById("VDisplayFancy");


            //set canvas for horizental card

            const HC = document.getElementById("HCanvas");
            const HCtx = HC.getContext("2d");

            var HCardImg = new Image();
            HCardImg.src = "/" + card.H_URL;
            HCtx.drawImage(HCardImg, 10, 10, HCardImg.width, HCardImg.height);

            //set canvas for vertical card

            const VC = document.getElementById("VCanvas");
            const VCtx = VC.getContext("2d");

            var VCardImg = new Image();
            VCardImg.src = "/" + card.V_URL;
            VCtx.drawImage(VCardImg, 10, 10, VCardImg.width, VCardImg.height);


            if (document.querySelector('input[name="greeting"]:checked') != null) {
                // add greeting graphic to horizental card

                var greetingImg = new Image();
                greetingImg.src = "/" + greeting.GreetingURL;
                HCtx.drawImage(greetingImg, card.H_Greeting_X, card.H_Greeting_Y, greetingImg.width * 0.5, greetingImg.height * 0.5);

                // add greeting graphic to vertical card

                VCtx.drawImage(greetingImg, card.V_Greeting_X, card.V_Greeting_Y, greetingImg.width, greetingImg.height);

            }
            var hfont = card.H_FontStyle;
            var vfont = card.V_FontStyle;

            if (allowFont == 1) { 
                
            if (document.querySelector('input[name="FontType"]:checked') != null) {
                font = document.querySelector('input[name="FontType"]:checked').value;
                }
                hfont = (card.H_FontStyle + " " + font).toString();
                vfont = (card.V_FontStyle + " " + font).toString();
            }


            //HCtx.font = "bold 15px bukra";
            //HCtx.fillStyle = "black";
            
            HCtx.font = "31px IBMPlex";
            HCtx.fillStyle = card.FontColor;
            HCtx.textAlign = "center";

            //VCtx.font = "bold 30px bukra";
            //VCtx.fillStyle = "black";
            
            VCtx.font = "40px IBMPlex";
            VCtx.fillStyle = card.FontColor;
            VCtx.textAlign = "center";

            var extraHY = 0;
            var extraVY = 0;

            // add message to horizental card
            if (document.querySelector('input[name="message"]:checked') != null) {

                wrapText(HCtx, message.MessageText, card.H_Message_X, card.H_Message_Y, card.H_LineLength, card.H_FontSize);

                // add message to vertical card

                wrapText(VCtx, message.MessageText, card.V_Message_X, card.V_Message_Y, card.V_LineLength, card.V_FontSize);
            }

HCtx.font = hfont;
VCtx.font = vfont;

            // add text to horizental card
            HCtx.fillText(nameTxt, card.H_Text_X, card.H_Text_Y + extraHY);

            // add text to vertical card
            VCtx.fillText(nameTxt, card.V_Text_X, card.V_Text_Y + extraVY);

            HDisplay.src = HC.toDataURL();
            VDisplay.src = VC.toDataURL();
            HDisplayFancy.href = HC.toDataURL();
            VDisplayFancy.href = VC.toDataURL();
        }
    }


    function wrapText(context, text, recived_x, recived_y, mw, lh) {
        var words = text.split(' ');
        var line = '';
        var maxWidth = parseInt(mw);
        var lineHeight = parseInt(lh);
        var x = parseInt(recived_x);
        var y = parseInt(recived_y);

        for (var n = 0; n < words.length; n++) {
            var testLine = line + words[n] + ' ';
            var metrics = context.measureText(testLine);
            var testWidth = metrics.width;
            if (testWidth > maxWidth && n > 0) {
                context.fillText(line, x, y);
                line = words[n] + ' ';
                y += lineHeight;
            }
            else {
                line = testLine;
            }
        }
        context.fillText(line, x, y);

    }

            }

        }
